import React, { Component } from 'react';
import { Route, NavLink } from 'react-router-dom';
import axios from 'axios';
import queryString from 'query-string';

class UnivInterviews extends Component {
	state = {
		interview: null,
	}

	componentDidMount() {
		const values = queryString.parse(this.props.location.search);
	 	const id = values.id;
	 	axios.get('https://interview-corner-1de29.firebaseio.com/interviews.json/' + id)
	 	.then(response => {
	 		this.setState({interview: response.data })
	 	});
	}

	render() {
		let interview = <div>Loading...</div>;
		if(this.state.interview) {
			const int = this.state.interview;
			interview = (
				<div>
					{int.name}{int.company}{int.college}{int.q1}{int.q2}
				</div>
			)
		}

		return (
			<div>
			Hdddddddddddddddddddddddddddddddddddddd
				{interview}
			</div>
		);
	}
}

export default UnivInterview;
